import React from 'react';

interface SynonymListProps {
  onSynonymClick: (synonym: string) => void;
}

const SynonymList: React.FC<SynonymListProps> = ({ onSynonymClick }) => {
  const synonyms = ['cardiovascular', 'heart disease', 'hypertension', 'stroke', 'atherosclerosis'];

  return (
    <div className="mt-4">
      <h3 className="text-lg font-semibold mb-2">Suggested Synonyms:</h3>
      <div className="flex flex-wrap gap-2">
        {synonyms.map((synonym, index) => (
          <button
            key={index}
            onClick={() => onSynonymClick(synonym)}
            className="px-3 py-1 bg-gray-200 text-gray-800 rounded-full hover:bg-gray-300 focus:outline-none focus:ring-2 focus:ring-gray-500 focus:ring-offset-2"
          >
            {synonym}
          </button>
        ))}
      </div>
    </div>
  );
};

export default SynonymList;
